import { useState, useEffect } from 'react';

import './App.css'
import { PROJECT_DIR } from './Const.js'

console.log(PROJECT_DIR)

const Navbar = () => {
	const [loggedin, setLoggedin] = useState(false)

	return (
		<div id="navbar">
			<h1 id="title">Sudoku</h1>
			<div id="navmenu">
				<button className='navbutton'></button>
			</div>
			<div id="loginsection">
				<img id="login-logo" src={`${PROJECT_DIR}imgs/user.svg`}></img>
				<p>{loggedin ? 'login' : 'account'}</p>
			</div>
		</div >
	)
}

const App = () => {
	return (
		<Navbar />
	)
}

export default App;
